import React, { useState } from "react";

import Todos from "./components/Todos";
import Todo from './models/todo';
import NewTodo from "./components/Newtodo";

import "./App.css";


function App() {
  const todos = [
    new Todo('Learn Rract'),
    new Todo('Learn TypeScript')
  ];

  return (
    <div>
      <NewTodo />
      <Todos items={todos} />
    </div>
  );
}

export default App;
